import React from "react";
import './filter.css';

import Checkbox from '../../Checkbox.svg';

export default function Filter() {
  return (
    <div className="filter-item">
      <label>
        <input type="checkbox" />
        <span>
          {Checkbox}
        </span>
      </label>
      <div>N пересадок</div>
    </div>
  );
}
